import osfrom openai import OpenAIAPI_KEY = 'sk-fd06a6d51bb24236a05f40b38b50bb0e'class Model:    def __init__(self, model_name,base_url= "https://api.deepseek.com"):        self.model_name = model_name        self.base_url = base_url        self.client = OpenAI(api_key=API_KEY, base_url=base_url)    def invoke(self,prompt):        response = self.client.chat.completions.create(            model=self.model_name,            messages=[{                "role": "user",                "content": prompt            }],            stream=False        )        return response.choices[0].message.contentllm = Model("deepseek-chat")print(llm.invoke("你好"))# gets API Key from environment variable OPENAI_API_KEYclient = OpenAI(    api_key="c0c4eaa3-f791-4806-9d97-dd425494c9e3",    base_url="https://ark.cn-beijing.volces.com/api/v3",)print("----- embeddings request -----")resp = client.embeddings.create(    model="doubao-embedding-large-text-250515",    input=["花椰菜又称菜花、花菜，是一种常见的蔬菜。"],    encoding_format="float")print(resp)class Embeddings():    def  __init__(self):        self.client = OpenAI(            api_key='c0c4eaa3-f791-4806-9d97-dd425494c9e3',            base_url="https://ark.cn-beijing.volces.com/api/v3",)    def embed_query(self,query):        resp = self.client.embeddings.create(            model="doubao-embedding-large-text-250515",            input=[query],            encoding_format="float"        )        return resp.data[0].embedding    def embed_documents(self,documents):        resp = self.client.embeddings.create(            model="doubao-embedding-large-text-250515",            input=documents,            encoding_format="float")        return [item.embedding for item in resp.data]embeddings = Embeddings()